import React from 'react';
import Mapa from "../../Utils/Img/Localidad/mapa.png";



function Cajamapa() {
	return (
	 
	
		 
	   
		<div className="Contenidolocalidad">
  
  
		<img id="imglocalidad" src={Mapa} alt="mapa" usemar="#mapa"/>
		<map id="mapa" name="imagemap1">
  <area shape="rect" coords="560,68,756,144" href="#map__item1" />
 
</map>
	  
		</div>
	  
		
			
	  
	  
  
	 
	);
  }
  
  export default Cajamapa;
